import React from 'react';

const Pagination = () => {
    return(
        <div>
            <div className="pagination-container">
                <a href="#" className="disabled">Prev</a>
                <a href="#" className="active">1</a>
                <a href="#">2</a>
                <a href="#">3</a>
                <a href="#">4</a>
                <a href="#">5</a>
            </div>
        </div>
    )
}

export default Pagination;
